import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./pages/Home.js";
import Layout from "./pages/Layout.js";
import AddBook from "./pages/AddBook.js";
import AllStudents from "./pages/AllStudents";
import NewStudent from "./pages/NewStudent.js";
import AllBooks from "./pages/AllBooks.js";
import DeleteBook from "./pages/DeleteBook.js";
import BookById from "./pages/BookById.js";
import StudentById from "./pages/StudentById.js";
import UpdateStudent from "./pages/UpdateStudent.js";
import UpdateBook from "./pages/StudentById.js";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route index element={<Home />} />
          <Route path="/" element={<Layout />}>
            <Route path="allbooks" element={<AllBooks />} />
            <Route path="book/:id" element={<BookById />} />
            <Route path="student/:id" element={<StudentById />} />
            <Route path="addbook" element={<AddBook />} />
            <Route path="deletedbooks" element={<DeleteBook />} />
            <Route path="allstudents" element={<AllStudents />} />
            <Route path="newstudent" element={<NewStudent />} />
            <Route path="updatestudent/:id" element={<UpdateStudent />} />
            <Route path="updatebook" element={<UpdateBook />} />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
